  JDODGSHUN, Anna Christine and GADDUM, Thomas Peter
  01> DODGSHUN, Anna Christine m on 11.02.1977 to GADDUM, Thomas Peter
  b 21.12.1953
  b 13.06.1949
  Anna b. and m. at Gisborne. Peter, s/o Frank James (Tom) Gaddum and Barbara H Baird. Address: 42
  Hauroa Road, Gisborne.
  Anna was educated at Woodford House and trained in nursing. At present she is working at Dunblane
  Centre in Gisborne. In her spare time she enjoys gardening.
  Peter was educated at Wanganui Collegiate School and is a farmer.
  01> GADDUM, Amelia Jane
  b 02.10.1978
  Amelia b. at Gisborne. She was educated at Woodford House and Gisborne Girls' High School
  where she excelled in art. She is now attending UNITEC Institute of Technology in Auckland
  where she has completed her intermediate year towards a Bachelor of Design.
  02> GADDUM, Hamish James
  b 27.10.1980
  Hamish b. at Gisborne.
  63> GADDUM, Jonathon Joseph
  b 10.03.1982
  Jonathon b. at Gisborne.
  04> GADDUM, Oliver Edward Peter
  b 08.03.1985
  Oliver b. at Gisborne.
  02> DODGSHUN, Susan Mary m on 24.01.1986 to HOLLAND, Keith John
  b 08.04.1955
  b 31.03.1957
  Susan b. and m, at Gisborne. Keith, s/o William Albert Holland and Ivy Winifred Linnett, b. at
  Auckland. Address: 284 Lake Road, Takapuna, Auckland.
  Susan was educated at Woodford House and is a fashion designer. She studied in New Zealand and
  Australia and obtained the Australian Diploma of Fashion Design. Since returning to New Zealand she
  has been designing for a fashion boutique in the Parnell Village in Auckland. Keith is a builder.
  01> HOLLAND, Olivia Amy
  b 16.04.1988
  Olivia b. at Auckland.
  02> HOLLAND, Abby Victoria
  b 07.05.1990
  Abby b. at Auckland.
  02>'DODGSHUN, Sydney Yorke m on 07.02.1948 to WOODWARD, Dorothy Virginia
  b 19.03.1919
  b 07.12.1926
  Sydney b. at Gisborne and m. at St Peter's Cathedral, Hamilton. Dorothy, d/o Arnold Adler Woodward (d.
  08.12.1967, civil engineer) and Eileen Vere Oakden (b. 18.05.1895, d. 04.11.1971) b, at Hamilton,
  Address: "Rauweka", 203a Pakowhai Road, RD 2, Gisborne.
  Sydney was educated at Gisborne Boys' High School and Wanganui Collegiate School. In 1937 he joined the
  staff of the Bank of New South Wales. He was a keen swimmer and was nominated for the 1938 Empire
  Games. During WW2 he served with the 25th Battalion in Greece, North Africa and Italy and on returning
  home he took up farming on "Rauweka" station, Syd is also an accomplished water colour artist.
